INSERT INTO `REPORTCUSTOMFILTERDEFINITION` (`REPORTCUSTOMFILTERDEFINITION_ID`,`DISPLAY_HTML`,`DISPLAY_TEXT`,`SQL_TEXT`) VALUES
 (100,'Codes - Account has a code type of <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0]\" value=\"{0}\" /> with any code value','Codes - Account has a code type of [CODETYPE] with any code value','EXISTS (SELECT * FROM ENTITYCODES WHERE ENTITYCODES.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND CODETYPE = \'{0}\')'),
 (200,'Codes - Account has a code type of <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0]\" value=\"{0}\" /> with any of the following code values : <br/> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1]\" value=\"{1}\" /> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[2]\" value=\"{2}\" /> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[3]\" value=\"{3}\" /> <BR> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[4]\" value=\"{4}\" /> <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[5]\"  value=\"{5}\" > <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[6]\" value=\"{6}\" />','Codes - Account has a code type of [CODETYPE] <br>with any of the following code values : [CODEVALUE], [CODEVALUE], [CODEVALUE], [CODEVALUE], or [CODEVALUE]','EXISTS (SELECT * FROM ENTITYCODES WHERE ENTITYCODES.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND CODETYPE = \'{0}\' AND CODEVALUE IN (\'{1}\', \'{2}\', \'{3}\', \'{4}\', \'{5}\'))'),
 (300,'Gift Totals - Account gave at least $<span class=\"criteriaWrapper\"><input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0]\" value=\"{0}\"style=\"width:75px\" fieldtype=\"MONEY\" /></span> in hard gifts in calendar year <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1]\" value=\"{1}\" style=\"width:75px\" />','Gift Totals - Account gave at least $[GIFTAMOUNT] in hard gifts in calendar year [GIFTYEAR]','((SELECT SUM(AMT) FROM GIFTHEADER WHERE GIFTHEADER.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND YEAR(GDATE) = {1}) >= {0})'),
 (350,'Gift Totals - Account gave at least <span class=\"criteriaWrapper\">$<input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0]\" value=\"{0}\" style=\"width:100px\" fieldtype=\"MONEY\" /></span> in hard gifts <br>between <span class=\"criteriaWrapper\"><input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1]\" fieldtype=\"DATE\" value=\"{1}\" style=\"width:110px\"/></span> and <span class=\"criteriaWrapper\"><input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[2]\" fieldtype=\"DATE\" value=\"{2}\" style=\"width:110px\"/></span>','Gift Totals - Account gave at least $[GIFTAMOUNT] in hard gifts between [GIFTDATE] and [GIFTDATE]','((SELECT SUM(AMT) FROM GIFTHEADER WHERE GIFTHEADER.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND GDATE BETWEEN {1} AND {2}) >= {0})'),
 (390,'Pledge Codes - Account has an active or fulfilled pledge code of <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0]\" value=\"{0}\" />','Pledge Codes - Account has an active or fulfilled pledge code of [PLEDGECODE]','EXISTS (SELECT * FROM GIFTPLEDGE WHERE GIFTPLEDGE.ENTITYID = [VIEWNAME].ENTITY_ENTITYID AND PLDGCODE = \'{0}\' AND STATUS IN (\'A\',\'F\'))'),
 (400,'Segmentation - Account is in segmentation job number <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0]\" value=\"{0}\" /> <br> and group number <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1]\" value=\"{1}\" />','Segmentation - Account is in segmentation job number [JOBNUMBER] and group number [GROUPNUMBER]','EXISTS (SELECT * FROM S{0}G{1} SEGTABLE WHERE SEGTABLE.ENTITYID = [VIEWNAME].ENTITY_ENTITYID)'),
 (500,'Segmentation - Account is in merge job number <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0]\" value=\"{0}\" />','Segmentation - Account is in merge job number [JOBNUMBER]','EXISTS (SELECT * FROM M{0} SEGTABLE WHERE SEGTABLE.ENTITYID = [VIEWNAME].ENTITY_ENTITYID)'),
 (600,'Zip Radius - Account is within <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[0]\" style=\"width:75px\" value=\"{0}\" /> miles of zip code <input class=\"customCriteria\" objectname=\"reportFilters[INDEXREPLACEMENT].reportCustomFilter.reportCustomFilterCriteria[1]\" style=\"width:100px\" value=\"{1}\" />','Zip Radius - Account is within [ZIPRADIUS] miles of zip code [ZIPCODE]','(CONVERT(VARCHAR(5), [VIEWNAME].ENTITY_POSTALCODE) IN (SELECT TOZIP.ZIPLOW AS POSTALCODE FROM ZIPCODES TOZIP CROSS JOIN (SELECT * FROM ZIPCODES FROMZIP WHERE FROMZIP.ZIPLOW = \'{1}\') FROMZIP WHERE SQRT(((69.1 * (TOZIP.LATITUDE - FROMZIP.LATITUDE)) * (69.1 * (TOZIP.LATITUDE - FROMZIP.LATITUDE))) + ((53 * (TOZIP.LONGITUDE - FROMZIP.LONGITUDE)) * (53 * (TOZIP.LONGITUDE - FROMZIP.LONGITUDE)))) <= {0}))'),
 (300000,'Account - Account is marked as a major donor','Account - Account is marked as a major donor','((SELECT MAJOR_DONOR FROM CONSTITUENT CONSTITUENTLOOKUP WHERE CONSTITUENTLOOKUP.CONSTITUENT_ID = [VIEWNAME].ADDRESS_CONSTITUENT_ID) = true)'),
 (310000,'Account - Account is marked as a major donor','Account - Account is marked as a major donor','((SELECT MAJOR_DONOR FROM CONSTITUENT CONSTITUENTLOOKUP WHERE CONSTITUENTLOOKUP.CONSTITUENT_ID = [VIEWNAME].AUDIT_CONSTITUENT_ID) = true)'),
 (320000,'Account - Account is marked as a major donor','Account - Account is marked as a major donor','((SELECT MAJOR_DONOR FROM CONSTITUENT CONSTITUENTLOOKUP WHERE CONSTITUENTLOOKUP.CONSTITUENT_ID = [VIEWNAME].COMMITMENT_CONSTITUENT_ID) = true)'),
 (330000,'Account - Account is marked as a major donor','Account - Account is marked as a major donor','((SELECT MAJOR_DONOR FROM CONSTITUENT CONSTITUENTLOOKUP WHERE CONSTITUENTLOOKUP.CONSTITUENT_ID = [VIEWNAME].COMMUNICATION_HISTORY_CONSTITUENT_ID) = true)'),
 (340000,'Account - Account is marked as a major donor','Account - Account is marked as a major donor','((SELECT MAJOR_DONOR FROM CONSTITUENT CONSTITUENTLOOKUP WHERE CONSTITUENTLOOKUP.CONSTITUENT_ID = [VIEWNAME].EMAIL_CONSTITUENT_ID) = true)'),
